import axios from "axios"
let token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOTI5NGJkZTc0NDAwMTAxZWFhNDE4ZiIsImlhdCI6MTY1NDY0NTYyMSwiZXhwIjoxNjU0NzMyMDIxfQ.5cT8HRF7s3jYIVzA5fn2vM4Fl-sSadzYJvKWHzkk7JQ"
export const getUsuariosRequest = async () => {
    await axios.get("/usuarios",{ headers: {"x-access-token" : `${token}`} })
}
